console.log("Hola Mundo!!!");

// Variables y Constantes

const nombre = "Fernando";

const apellidos = "Herrera";

let valorDado = 5;
valorDado = 4;

console.log(nombre, " ", apellidos, " ", valorDado);

if (true) {
  let valorDado = 6;
  console.log("Valor Dado ", valorDado);
}

console.log("Valor Dado ", valorDado);
